import logo from './logo.svg';
import './App.css';
import {createStore} from 'redux';
import {reducer} from './reducers/index'
import {plus, minus} from './actions/index'

const store = createStore(reducer)

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button>+</button>
        <p>number</p>
        <button>-</button>
      </header>
    </div>
  );
}

export default App;
